  [],\n\t\"num_tags\": 0,\n\t\"name\": \"ncei-binned-level-3-sea-surface-salinity-from-aquarius-satalite-de-aplicaciones-cientaficas-sac\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The data quality monitoring system (DQMS)
  for the Aquarius/Satu00c3u00a9lite de Aplicaciones Cientu00c3u00adficas (SAC)-D
  satellites level-2 sea-surface salinity (SSS) swath data was developed by the National
  Centers for Environmental Information (NCEI) satellite oceanography team. As an
  important component of DQMS, NCEI also generates 1.0 degree longitude/latitude gridded
  level-3 SSS data using box averages over the global ocean. The datasets comprise
  monthly and 7-day means including both the NASA Goddard Space Flight Center's Aquarius
  Data Processing System (ADPS) and Combined Active-Passive (CAP) algorithm fields
  produced at the Jet Propulsion Laboratory (JPL).nNCEI-binned quick-look level-3
  SSS datasets are generated directly from Aquarius Level-2 products (currently V4.0).
  They improve the application of satellite SSS products in NOAA by minimizing the
  data latency to within 24 hours of Level-2 data availability.\",\n\t\"owner_org\":
